// 辅助函数：搜索所有数据
export function searchAllItems(query: string): SearchItem[] {
  if (!query.trim()) return [];

  const lowerQuery = query.toLowerCase();

  // 合并分类和工具数据进行搜索
  const allItems = [...searchData.category, ...searchData.tool];

  return allItems
    .filter((item) => item.n.toLowerCase().includes(lowerQuery))
    .sort((a, b) => b.c - a.c); // 按热度排序
}

// 辅助函数：搜索工具
export function searchTools(query: string): SearchItem[] {
  if (!query.trim()) return [];

  const lowerQuery = query.toLowerCase();

  return searchData.tool
    .filter((item) => item.n.toLowerCase().includes(lowerQuery))
    .sort((a, b) => b.c - a.c); // 按热度排序
}

// 辅助函数：搜索分类
export function searchCategories(query: string): SearchItem[] {
  if (!query.trim()) return [];

  const lowerQuery = query.toLowerCase();

  return searchData.category
    .filter((item) => item.n.toLowerCase().includes(lowerQuery))
    .sort((a, b) => b.c - a.c); // 按热度排序
}

// 辅助函数：获取热门工具（按热度排序）
export function getPopularTools(limit: number = 10): SearchItem[] {
  return [...searchData.tool].sort((a, b) => b.c - a.c).slice(0, limit);
}

// 辅助函数：获取热门分类（按热度排序）
export function getPopularCategories(limit: number = 10): SearchItem[] {
  return [...searchData.category].sort((a, b) => b.c - a.c).slice(0, limit);
}

export default searchData;
